import React from "react";
import styled from "styled-components";
import Navbar from "../components/Navbar"; // Assure-toi d'importer ton composant Navbar

const LayoutContainer = styled.div`
  display: flex;
`;

const ContentContainer = styled.main`
  flex-grow: 1;
  padding: 2rem;
`;

// Pass User
const Dashboard = ({ user }) => {
  return (
    <LayoutContainer>
      <Navbar user={user} />
      <ContentContainer>
        <div>
          <h1>Dashboard</h1>
          <p>Welcome, {user.name}</p>
        </div>
      </ContentContainer>
    </LayoutContainer>
  );
};

export default Dashboard;
